import React from "react";

import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faCoffee , faCalendar, faClock , faFloor} from '@fortawesome/free-solid-svg-icons';

const AddBooking = () => {
  return (
    <>
      <form>
        <div>s
          <label htmlFor="titre"></label>
          <input type="text" name="titre" id="" placeholder="my reservation"/>
        </div>
        <div>
          <label htmlFor="">Description</label>
          <input type="text" name="" id="" />
        </div>
        <div>
            <FontAwesomeIcon icon={faCoffee} />
        </div> 
        <div><FontAwesomeIcon icon={faCalendar} /> </div>
        <div></div>
        <div></div>
        
         
        <FontAwesomeIcon icon={faFloor} /> 


    
    </form>
    </>
  );
};

export default AddBooking;
